import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div className="home-container">
      <img src="/logo.png" alt="T-Draw Logo" className="home-logo" />
      <h1 className="home-title">T-Draw</h1>
      <p className="home-subtitle">Plataforma de Login e Gerenciamento de Acessos</p>
      
      <div className="home-nav">
        <Link to="/login" className="home-nav-button primary">
          Fazer Login
        </Link>
        <Link to="/access-manager" className="home-nav-button">
          Gerenciar Acessos
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
